import sys
import time


class Solution:
    def countStr(self, s):
        out_t = {}
        for char in s:
            try :
                out_t[char]+=1
            except KeyError:
                out_t[char]=1
        return out_t

    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        s_len = len(s)
        if not s_len:
            return ""
        t_len = len(set(t))
        if not t_len:
            return s[0]

        target_t=self.countStr(t)

        first_t, last_t = 0, 0
        min_first, min_last = 0, s_len + 1

        contain_num=0
        while True:
            while last_t < s_len and contain_num<t_len:
                if s[last_t] in t:
                    target_t[s[last_t]] -= 1
                    if target_t[s[last_t]]==0:
                        contain_num+=1
                last_t += 1
            if contain_num<t_len:
                break

            while first_t < last_t:
                if s[first_t] in t:
                    target_t[s[first_t]]+= 1
                    if target_t[s[first_t]] > 0:
                        contain_num-=1
                        first_t += 1
                        break
                first_t += 1

            if (last_t - first_t+1) < (min_last - min_first):
                min_first, min_last = first_t-1, last_t

            if last_t == s_len:
                break
        return "" if min_last == s_len + 1 else s[min_first:min_last]


if __name__ == "__main__":

    if sys.version_info.major == 3:
        t0 = time.perf_counter()
    else:
        t0 = time.time()

    test_list = ["DADOBOECOAEBANCD", "AA", "",""]
    test_list_2 = ["ABC", "AA", "A","kg"]
    answer_list = ["BANC", "AA", "","kg"]

    test = Solution()
    for i in range(len(test_list)):
        out_t = test.minWindow(test_list[i], test_list_2[i])

        if out_t == answer_list[i]:
            print("\033[1;32;40m  Pass \033[0m")
        else:
            print(
                "\033[1;31;40m  Fail!!\033[0m\033[0;34;40m out \"%s\" should \"%s\" by \"%.50s\" "
                % (out_t, answer_list[i],
                   str(test_list[i]) + " " + str(test_list_2[i])))

    if sys.version_info.major == 3:
        print("\nRun Time is %f s" % (time.perf_counter() - t0))
    else:
        print("\nRun Time is %f s" % (time.time() - t0))


